import PropTypes from 'prop-types';
import Table from '../shared/Table/Table';

const columns = [
    {
        title: 'First Name',
    },
    {
        title: 'Last Name',
    },
    {
        title: 'Email',
    },
    {
        title: 'Password',
    },
];

const History = props => {
    return <Table columns={columns} />;
};

History.propTypes = {};

export default History;
